app.controller("accountController",["$scope","accountFactory",(r,s)=>{$("#resetPaswordForm").form({on:"blur",fields:{password:{identifier:"password",rules:[{type:"empty",prompt:"Please enter a valid password"}]},passwordConfirm:{identifier:"passwordConfirm",rules:[{type:"match[password]",prompt:"Mismatched Password"}]}},onSuccess:()=>{r.resetPassword()}}),r.resetPassword=(()=>{s.resetPassword(r.resetPasswordData).then(s=>{1===s.status?console.log("ok"):r.resetPaswordErr=s.error})})}]);